"use strict";(self.webpackChunky_doc=self.webpackChunky_doc||[]).push([[8130],{7735:n=>{n.exports=JSON.parse('{"archive":{"blogPosts":[{"id":"updateYbc","metadata":{"permalink":"/blog/updateYbc","editUrl":"https://github.com/xYuan20d/Yuml-doc/edit/main/blog/updateYbc.md","source":"@site/blog/updateYbc.md","title":"\u2728 Yuml \u67b6\u6784\u5347\u7ea7\uff1a\u6211\u4eec\u5982\u4f55\u7528 SQLite \u5b9e\u73b0 YAML \u7684\u60f0\u6027\u52a0\u8f7d\u4e0e\u7f16\u8bd1\u6267\u884c","description":"Yuml \u65b0\u7248\u672c\u5f15\u5165\u4e86\u4e00\u9879\u5173\u952e\u6027\u7684\u5e95\u5c42\u5347\u7ea7 \u2014\u2014","date":"2025-07-01T00:00:00.000Z","tags":[{"inline":false,"label":"Yuml","permalink":"/blog/tags/Yuml","description":"\u6b22\u8fce\u6765\u5230Yuml\u6807\u7b7e"}],"readingTime":1.95,"hasTruncateMarker":true,"authors":[{"name":"YuanYuan","title":"Yuml \u8bed\u8a00\u4f5c\u8005","url":"https://github.com/xYuan20d","socials":{"github":"https://github.com/xYuan20d"},"page":{"permalink":"/blog/authors/YuanYuan"},"imageURL":"https://github.com/xYuan20d.png","key":"yuan"}],"frontMatter":{"slug":"updateYbc","title":"\u2728 Yuml \u67b6\u6784\u5347\u7ea7\uff1a\u6211\u4eec\u5982\u4f55\u7528 SQLite \u5b9e\u73b0 YAML \u7684\u60f0\u6027\u52a0\u8f7d\u4e0e\u7f16\u8bd1\u6267\u884c","date":"2025-07-01T00:00:00.000Z","authors":["yuan"],"tags":["Yuml"]},"unlisted":false,"nextItem":{"title":"\u7b2c\u4e00\u6761\u5e16\u5b50","permalink":"/blog/post1"}},"content":"Yuml \u65b0\u7248\u672c\u5f15\u5165\u4e86\u4e00\u9879\u5173\u952e\u6027\u7684\u5e95\u5c42\u5347\u7ea7 \u2014\u2014  \\n\u6211\u4eec\u91cd\u65b0\u8bbe\u8ba1\u4e86\u89e3\u6790\u6267\u884c\u7684\u6574\u4e2a\u6d41\u7a0b\uff0c**\u544a\u522b\u91cd\u590d\u6e32\u67d3 + \u5168\u91cf\u52a0\u8f7d\u7684\u65f6\u4ee3**\uff0c\u6b63\u5f0f\u8fc8\u5165**\u5b57\u8282\u7801 + \u60f0\u6027\u52a0\u8f7d\u7684\u9ad8\u6027\u80fd\u9636\u6bb5**\u3002\\n\\n\x3c!--truncate--\x3e\\n\\n## \ud83e\udde0 \u95ee\u9898\u56de\u987e\uff1a\u65e7\u67b6\u6784\u7684\u74f6\u9888\\n\\n\u5728\u65e7\u7248\u672c\u4e2d\uff0cYuml \u7684\u542f\u52a8\u6d41\u7a0b\u5982\u4e0b\uff1a\\n\\n1. \u8bfb\u53d6\u539f\u59cb `.yaml` \u6587\u4ef6\uff1b\\n2. \u901a\u8fc7 `jinja2` \u6e32\u67d3\u6a21\u677f\u903b\u8f91\uff1b\\n3. \u4f7f\u7528 `ruamel.yaml` \u89e3\u6790 YAML\uff1b\\n4. \u5c06\u5176\u8f6c\u6362\u4e3a `dict`\uff0c\u4f9b\u89e3\u91ca\u5668\u8fd0\u884c\u3002\\n\\n\u867d\u7136\u8fd9\u79cd\u673a\u5236\u5bf9\u5c0f\u9879\u76ee\u8db3\u591f\uff0c\u4f46\u5f53 YAML \u6587\u4ef6**\u5d4c\u5957\u7ed3\u6784\u590d\u6742\u3001\u6a21\u5757\u6570\u91cf\u591a\u65f6**\uff0c\u4ee5\u4e0b\u95ee\u9898\u663e\u73b0\uff1a\\n\\n- \u23f3 **\u542f\u52a8\u901f\u5ea6\u6781\u6162**\uff1a\u6bcf\u6b21\u90fd\u91cd\u590d\u6267\u884c jinja2 + YAML \u89e3\u6790\uff1b\\n- \ud83d\udca5 **\u5185\u5b58\u5360\u7528\u5267\u589e**\uff1a\u5168\u91cf dict \u52a0\u8f7d\u4f1a\u4e00\u6b21\u6027\u5360\u7528\u5927\u91cf\u5185\u5b58\uff1b\\n- \ud83d\udc0c **\u6027\u80fd\u4e0e\u89c4\u6a21\u6210\u53cd\u6bd4**\uff1a\u9879\u76ee\u8d8a\u5927\u3001\u8d8a\u5361\u3002\\n\\n\u4e8e\u662f\uff0c\u6211\u4eec\u51b3\u5b9a \u2014\u2014 **\u52a8\u624b\u91cd\u6784\u8fd0\u884c\u6838\u5fc3**\u3002\\n\\n---\\n\\n## \u2728 \u65b0\u67b6\u6784\uff1aybc \u5b57\u8282\u7801\u7cfb\u7edf\u4e0a\u7ebf\uff01\\n\\n\u6211\u4eec\u8bbe\u8ba1\u4e86\u4e00\u79cd\u5168\u65b0\u7684\u8fd0\u884c\u673a\u5236\uff1a\\n\\n> **\u5c06 YAML \u7f16\u8bd1\u4e3a SQLite \u5b58\u50a8\u7ed3\u6784\uff08ybc\uff09\uff0c\u6309\u9700\u8bbf\u95ee\u6267\u884c\u5185\u5bb9\u3002**\\n\\n\u4f60\u53ef\u4ee5\u628a `.ybc` \u7406\u89e3\u4e3a\u4e00\u4e2a **\u7ed3\u6784\u5316\u7684\u952e\u503c\u6570\u636e\u5e93 + \u5b57\u8282\u7801\u5bb9\u5668**\uff0c\u5b83\u5177\u5907\u4ee5\u4e0b\u7279\u6027\uff1a\\n\\n### \ud83d\udd25 \u7f16\u8bd1\u673a\u5236\uff08\u4e00\u6b21\u7f16\u8bd1\uff0c\u591a\u6b21\u8fd0\u884c\uff09\\n- \u9996\u6b21\u6784\u5efa\u65f6\uff0c\u5c06 `.yaml` \u7f16\u8bd1\u4e3a `.ybc` \u6587\u4ef6\uff1b\\n- \u7f16\u8bd1\u8fc7\u7a0b\u4e2d\uff0c\u5b8c\u6210\u6a21\u677f\u6e32\u67d3 + AST \u63d0\u53d6 + SQLite \u5199\u5165\uff1b\\n- \u8fd0\u884c\u65f6\uff0cYuml \u76f4\u63a5\u8bfb\u53d6 `.ybc`\uff0c**\u4e0d\u518d\u89e3\u6790 YAML \u539f\u6587**\u3002\\n\\n### \u2744\ufe0f \u60f0\u6027\u52a0\u8f7d\uff08\u7528\u591a\u5c11\uff0c\u8bfb\u591a\u5c11\uff09\\n\u65e7\u7248\u4f1a\u5c06\u6574\u4e2a dict \u4e00\u6b21\u6027\u52a0\u8f7d\u81f3\u5185\u5b58\uff0c\u65b0\u7248\u6539\u4e3a\uff1a\\n\\n> **\u8fd0\u884c\u65f6\u53ea\u8bfb\u53d6\u4f60\u8bbf\u95ee\u7684\u90a3\u4e2a\u952e\u503c\uff0c\u800c\u975e\u6574\u68f5\u6811\u3002**\\n\\n\u8fd9\u5f97\u76ca\u4e8e SQLite \u7684\u952e\u503c\u67e5\u627e\u80fd\u529b\uff0c\u6211\u4eec\u53ef\u4ee5\u505a\u5230\uff1a\\n- \u53ea\u52a0\u8f7d\u9700\u8981\u7684\u5206\u652f\uff1b\\n- **\u52a8\u6001\u3001\u4f4e\u6210\u672c\u5730\u89e3\u6790\u6267\u884c\u903b\u8f91**\uff1b\\n- \u5927\u5e45\u8282\u7701\u5185\u5b58\uff08\u5b9e\u6d4b\u5185\u5b58\u5360\u7528\u4e0b\u964d 80%+\uff09\uff1b\\n\\n---\\n\\n## \ud83e\uddea \u793a\u4f8b\u5bf9\u6bd4\uff1a\u65e7 vs \u65b0\\n\\n| \u9879\u76ee | YAML \u884c\u6570 | \u542f\u52a8\u65f6\u95f4\uff08\u65e7\uff09 | \u542f\u52a8\u65f6\u95f4\uff08\u65b0\uff09 | \u5185\u5b58\u5360\u7528 |\\n|------|-----------|----------------|----------------|-----------|\\n| \u5c0f\u9879\u76ee | 300 \u884c     | 200ms          | 60ms           | 30MB \u2192 10MB |\\n| \u4e2d\u578b\u9879\u76ee | 2000 \u884c   | 1.4s           | 0.4s           | 120MB \u2192 25MB |\\n| \u8d85\u5927\u9879\u76ee | >1w \u884c    | \u65e0\u6cd5\u542f\u52a8\ud83d\udca5     | 1.1s           | \u274c \u2192 40MB |\\n\\n---\\n\\n## \ud83d\udee0\ufe0f \u53cc\u6a21\u5f0f\u652f\u6301\uff1a\u5f00\u53d1 & \u90e8\u7f72\u90fd\u65b9\u4fbf\\n\\n\u4e3a\u4e86\u517c\u987e\u5f00\u53d1\u4f53\u9a8c\u4e0e\u90e8\u7f72\u6027\u80fd\uff0c\u65b0\u7248\u672c\u4fdd\u7559\u4e24\u79cd\u8fd0\u884c\u65b9\u5f0f\uff1a\\n\\n| \u6a21\u5f0f | \u63cf\u8ff0 | \u63a8\u8350\u7528\u9014 |\\n|------|------|-----------|\\n| `.yaml` \u76f4\u8dd1 | \u4fdd\u7559\u89e3\u91ca\u5668\u52a8\u6001\u6027 | \u5feb\u901f\u8c03\u8bd5\u3001\u5f00\u53d1\u9636\u6bb5 |\\n| `.ybc` \u7f16\u8bd1\u8fd0\u884c | \u7ed3\u6784\u5316 + \u60f0\u6027 | \u90e8\u7f72\u4e0a\u7ebf\u3001\u8ffd\u6c42\u6027\u80fd\u573a\u666f |"},{"id":"post1","metadata":{"permalink":"/blog/post1","editUrl":"https://github.com/xYuan20d/Yuml-doc/edit/main/blog/post1.md","source":"@site/blog/post1.md","title":"\u7b2c\u4e00\u6761\u5e16\u5b50","description":"\u2728 \u6b22\u8fce\u6765\u5230\u672c\u7ad9\u7684\u7b2c\u4e00\u7bc7\u5e16\u5b50\uff01\ud83c\udf89","date":"2025-06-22T00:00:00.000Z","tags":[{"inline":false,"label":"Hello","permalink":"/blog/tags/hello","description":"Hello tag description"}],"readingTime":0.16,"hasTruncateMarker":true,"authors":[{"name":"YuanYuan","title":"Yuml \u8bed\u8a00\u4f5c\u8005","url":"https://github.com/xYuan20d","socials":{"github":"https://github.com/xYuan20d"},"page":{"permalink":"/blog/authors/YuanYuan"},"imageURL":"https://github.com/xYuan20d.png","key":"yuan"}],"frontMatter":{"slug":"post1","title":"\u7b2c\u4e00\u6761\u5e16\u5b50","date":"2025-06-22T00:00:00.000Z","authors":["yuan"],"tags":["hello"]},"unlisted":false,"prevItem":{"title":"\u2728 Yuml \u67b6\u6784\u5347\u7ea7\uff1a\u6211\u4eec\u5982\u4f55\u7528 SQLite \u5b9e\u73b0 YAML \u7684\u60f0\u6027\u52a0\u8f7d\u4e0e\u7f16\u8bd1\u6267\u884c","permalink":"/blog/updateYbc"}},"content":"\u2728 \u6b22\u8fce\u6765\u5230\u672c\u7ad9\u7684\u7b2c\u4e00\u7bc7\u5e16\u5b50\uff01\ud83c\udf89\\n\\n\u5982\u679c\u4f60\u4e0d\u5acc\u9ebb\u70e6\uff0c\u6b22\u8fce\u70b9\u51fb\u53f3\u4e0b\u65b9\u7684\u300c\ud83d\udcac\u300d\u6309\u94ae \ud83d\udc49  \\n\u767b\u5f55\u4e00\u4e0b\uff0c\u7559\u8a00\u300c\u5230\u6b64\u4e00\u6e38\u300d\uff0c\u8ba9\u6211\u77e5\u9053\u4f60\u6765\u8fc7\\n\\n\x3c!--truncate--\x3e\\nCiallo\uff5e(\u2220\u30fb\u03c9< )\u2312\u2605"}]}}')}}]);